import { Fab } from "@material-ui/core";
import { Add } from "@material-ui/icons";
import { withStyles } from "@material-ui/core/styles";

export default withStyles(styles)(({ classes }) => {
  return (
    <Fab size="small">
      <Add />
    </Fab>
  );
});
